INSERT INTO `companies` VALUES (8,33,'Планета','ООО \"Планета\"','ул. Уральская, д. 30','8(888)-12-221-34','Компания «Планета» основана в 2005 году,  является лидером российского рынка  по производству оборудования для полнокупольной проекции в России, входит в состав  Международного Сообщества (IPS) и Российской Ассоциации Планетариев (АПР).\r\n\r\nОсновной миссией компании является возрождение Планетариев в России и открытие Стационарных  Планетариев Full Dome.\r\n\r\n \r\n\r\n \r\n\r\nОсновные направления деятельности компании:\r\n-  производство оборудования для полнокупольной проекции;\r\n\r\n- разработка проекционных 3D технологий;\r\n\r\n- производство контентов (фильмов и видеосюжетов),\r\n\r\nрассчитанных на полнокупольную проекцию;\r\n\r\n- организация лекций в дошкольных и общеобразовательных учреждениях.\r\n\r\nОтдельным направлением можно выделить производство:\r\n\r\n1. Стационарных Планетарии Full Dome (это новое поколение систем визуализации для науки и развлечений. В такой системе проекция транслируется на весь купол, что позволяет обеспечить панорамный обзор (360º) для зрителей, создавая «эффект погружения». В проекционной системе Планетария предусмотрена техническая возможность демонстрации контента в 3D-режиме).\r\n\r\n2. Мобильные Цифровые Планетарии (надувная конструкция, внутренняя поверхность которой представляет полусферу, адаптированную для проецирования изображения. Обеспечена проекционнй системой панорамного изображения и возможностью демонстрации фильмов в 3D-режиме);\r\n\r\n3. Купола FD (сферическая конструкция, состоящая из сложной сети треугольников. Это инновационный проект создания универсальных сферических сооружений от 5 метров и идеальное решение в организации Ваших мероприятий).          \r\n\r\nБольшое внимание компании уделяется инновационному технологическому развитию: активно разрабатываются новые проекционные решения - панорамная, сферическая и планетарная проекция с применением технологии стереоскопической 3D-визуализации. Вместе с этим компания активно занимается созданием полнокупольного контента (фильмов) как для образовательных учреждений (узкоспециализированные, тематические лекции), так и для культурных учреждений (обобщенные красочные фильмы для просмотра всей семьей).','planeta-logo_429440.jpg','2013-01-30 05:22:17','2013-04-25 20:24:03',246,11,1,'8(888)-12-221-34','1226521452','51452562156252',NULL,1,'Альфа-Банк \r\n\r\nКРЕДИТ ПРЕДОСТАВЛЯЕТСЯ ОАО «АЛЬФА-БАНК», ГЕНЕРАЛЬНАЯ ЛИЦЕНЗИЯ НА ОСУЩЕСТВЛЕНИЕ БАНКОВСКИХ ОПЕРАЦИЙ № 1326 ОТ 05 МАРТА 2012 Г. ПЕРВЫЙ ВЗНОС 0% ОТ ЦЕНЫ ТОВАРА, 0% ПЕРЕПЛАТА ЗА ТОВАР В КРЕДИТ ОТ РОЗНИЧНОЙ ЦЕНЫ, СРОК КРЕДИТА 24 МЕСЯЦА, ПРОЦЕНТНАЯ СТАВКА 10,00% ГОДОВЫХ, ПОЛНАЯ СТОИМОСТЬ КРЕДИТА СОСТАВЛЯЕТ 10,47% ГОДОВЫХ. ООО \"М.ВИДЕО МЕНЕДЖМЕНТ\" ПРЕДОСТАВЛЯЕТ ПОКУПАТЕЛЯМ СКИДКУ С ЦЕНЫ ТОВАРА, ПРИОБРЕТАЕМОГО В КРЕДИТ, ЭТО ПОНИЖАЕТ СТОИМОСТЬ КРЕДИТА ТАК, ЧТО ИТОГОВАЯ СУММА КРЕДИТА С УЧЕТОМ СУММЫ ПРОЦЕНТОВ НЕ ПРЕВЫШАЕТ ПЕРВОНАЧАЛЬНОЙ СТОИМОСТИ ТОВАРА. СУММА КРЕДИТА ОТ 2000 ДО 150000 РУБ. ПРИ ПОГАШЕНИИ КРЕДИТА ЧЕРЕЗ ТРЕТЬИХ ЛИЦ ВЗИМАЕТСЯ КОМИССИЯ СОГЛАСНО ИХ ТАРИФАМ. СПИСОК ТОВАРА, НА КОТОРЫЙ ДЕЙСТВУЕТ ПРЕДЛОЖЕНИЕ, ОГРАНИЧЕН. ПОДРОБНОСТИ ПОКУПКИ В КРЕДИТ УТОЧНЯЙТЕ У СОТРУДНИКОВ БАНКОВ В МАГАЗИНАХ «М.ВИДЕО».'),(9,1,'Копм-ремонт','ООО \"Копм-ремонт\"','ул. Советская, д. 92','8(3232)23-02-02','Мы ремонтируем компьютеры любой сложности поломки. Разумные сроки и разумные цены.','comp-remont.jpeg','2013-01-31 22:50:29','2013-04-25 20:24:22',270,20,0,'','','',NULL,1,'');
