INSERT INTO `feedbacks` VALUES (1,'Компьютер DNS Extreme','Купил пользуюсь и подумываю заменить его на что нибудь что работает быстрее.','Хороший дизайн корпуса, не большая цена','Система притормаживает, проблемы с установкой драйверов',1,0,13,'Good','2013-02-02 09:25:41','2013-02-02 09:25:41',25),(2,'Ноутбук Asus','Неделю пользуюсь, полет нормальный, только садится батарея быстро','Удобная клавиатура, большой угол обзора, мощные кишки','Быстро садится батарея, мало портов USB',33,1,11,'Good','2013-02-02 11:49:40','2013-02-02 11:49:40',25),(3,'Хорошо ремонтируют старое барохло','Отдал свой телек на ремонт который валялся в гараже уже больше 10ти лет ради интереса. И что Вы думаете?Они его отремонтировали))','Быстро и не дорого','Очень неудобное расположение сервиса',1,1,3,'Service','2013-02-10 11:40:21','2013-02-10 11:40:21',26),(4,'-','sdfghj','awesdfghjk','ропавыф',1,1,3,'Campaign','2013-03-12 18:36:24','2013-03-12 18:36:24',19),(5,'-','Отливная техника. советую','Мощный, маневренный','Капризен к топливу, дорогие расходные материалы',1,1,14,'Good','2013-03-13 08:36:10','2013-03-13 08:36:10',35),(6,'-','укеукеук','укуекуе','укеуке',1,1,14,'Good','2013-03-13 11:47:59','2013-03-13 11:47:59',35),(7,'-','Наконец в этой глухой, уединенной деревушке его поиски закончились. В ветхой избушке у огня сидела Правда.\n\nОн никогда не видел более старой и уродливой женщины.\n\n— Вы — Правда?\n\nСтарая, сморщенная карга торжественно кивнула.\n\n— Скажите же, что я должен сообщить миру? Какую весть передать?\n\nСтаруха плюнула в огонь и ответила:\n\n— Скажи им, что я молода и красива!\n','ыфажолдвап','ваплвыдаыподв',1,0,14,'Good','2013-03-13 11:49:11','2013-03-13 11:49:11',35),(8,'-','Прелестно','Прелестно','Прелестно',1,1,9,'Company','2013-03-15 19:41:22','2013-03-15 19:41:22',30);
