INSERT INTO `goods` VALUES (3,19,8,'Компьютер DNS Prestige XL ','В рамках серии ПК ДНС Prestige выпускаются компьютеры с максимальной производительностью как вычислительной, так и графической части. Этих конфигураций хватает для любой современной игры на максимальных или близких к ним настройкам графики, а также максимально комфортной работы в любом пакете программ, предназначенных к домашнему использованию. Благодаря качественным комплектующим и высокому уровню контроля сборки, вы можете рассчитывать на отличное качество этих компьютеров.','2013-01-30 05:31:18','2013-04-24 20:07:52',32000,22,0,'148610_0.1358917450.jpg','DNS',NULL,NULL,NULL,NULL,NULL),(4,19,8,'Компьютер DNS Prestige 014','В рамках серии ПК ДНС Prestige выпускаются компьютеры с максимальной производительностью как вычислительной, так и графической части. Этих конфигураций хватает для любой современной игры на максимальных или близких к ним настройкам графики, а также максимально комфортной работы в любом пакете программ, предназначенных к домашнему использованию. Благодаря качественным комплектующим и высокому уровню контроля сборки, вы можете рассчитывать на отличное качество этих компьютеров.','2013-01-30 05:33:25','2013-04-24 12:36:33',23000,25,0,'148061_0.1350699448.jpg','DNS',NULL,NULL,NULL,NULL,NULL),(5,20,8,'Монитор DNS 27','Диагональ экрана	27\"\r\nМаксимальное разрешение	1920x1080\r\nLED подсветка	есть\r\nШирокоформатный	есть\r\nЭкран\r\nСенсорный экран	нет\r\n','2013-01-30 05:35:47','2013-04-24 06:13:16',7350,20,1,'144680_0.1337325912.jpg','DNS',NULL,NULL,NULL,NULL,NULL),(6,20,8,'Монитор Dell 23','Dell UltraSharp U2312HM новый 23-дюймовый обладающий  ярким и насыщенным изображением, которое доступно для просмотра практически под любым углом. Этот монитор оснащен светодиодной подсветкой, его можно регулировать по высоте. Технологии IPS, даст вам возможность почувствовать весь диапазон мельчайших деталей, а так-же необыкновенную точность воспроизведения цветов при любой дальности просмотра. Предусмотрена возможность регулировки наклона и поворота в горизонтальной и вертикальной плоскостях и высоты.','2013-01-30 05:37:17','2013-04-24 12:36:30',9000,18,1,'136563_0.1354857107.jpg','Dell',NULL,NULL,NULL,NULL,NULL),(7,17,8,'Ноутбук Acer Aspire One AO725','Стильный тонкий аккуратный корпус, отличная сборка... 1 USB3.0 + 2 USB2.0, HDMI, отличная HD Веб-камера, Bluetooth 4.0, яркий сочный экран с HD-разрешением, мощнейшая для нетбуков видеокарта, 2-х ядерный проц с TurboBoost до 1333MHz, память DDR3 1066, емкий и быстрый HDD 500Gb, хороший быстрый доступ (всего 1 винтик) к устройствам (память, HDD), ну и наконец Win 7 HB (не Starter!!!) плюс установлен пакет MS Office Starter ','2013-01-30 05:39:35','2013-04-24 12:36:28',9990,14,1,'147651_0.1338367856.jpg','Acer',NULL,NULL,NULL,NULL,NULL),(10,18,8,'Рюкзак Case Logic ZLB-116','Уплотненное внутреннее отделение для ноутбука с вертикальной загрузкой;\r\nОбъемное внутреннее отделение для документов и аксессуаров;\r\nЗапатентованная технология внешнего кармана Smart Organization™ обеспечивает быстрый доступ к телефону, КПК, МР3 плееру.\r\nДополнительный карман на «молнии» для блока питания, «мыши» и других аксессуаров;\r\nВнутренние кармашки для карт памяти, ручек, документов;\r\nСпинка из мягкого материала для дополнительного комфорта;\r\nРегулируемый плечевой ремень с накладкой, предотвращающей скольжение.\r\nВозможность крепить рюкзак на багажную сумку.','2013-01-30 05:44:23','2013-04-24 12:36:21',2200,27,1,'125698_0.1321139987.jpg',NULL,NULL,NULL,NULL,NULL,NULL),(11,17,8,'Ноутбук Asus','• Система охлаждения IceCool; • Алюминиевая поверхность корпуса; • Эргономичная клавиатура, наслужившая награду дизайнерского конкурса iF;','2013-01-30 05:45:52','2013-05-20 05:22:42',15000,36,1,'155290_0.1344916028.jpg','Asus fi',NULL,NULL,NULL,NULL,NULL),(12,17,8,'[Gamer] Ноутбук DNS','Сборка ничего не шатается и не скрипит, клавиатура не пргибается, мягкий пластик, технические характеристики, матовый экран (не глянцевый как в описании), не урезанная geforce 650м','2013-01-30 05:47:14','2013-05-20 05:22:36',27500,32,1,'155650_0.1345695612.jpg','DNS',NULL,NULL,NULL,NULL,NULL),(13,19,9,'Компьютер DNS Extreme','Компьютеры DNS Extreme представляют собой сбалансированные игровые конфигурации – по сути, универсальные домашние компьютеры, предлагающие оптимальный баланс производительности и цены и пригодные к любым задачам. ПК этой серии смогут тянуть любые современные игры в Full HD разрешении с настройками от средних до высоких, и конечно же любые программные пакеты. Конфигурации серии Extreme предлагают в 2 раза более емкий жесткий диск и в 2 раза больший объем оперативной памяти, чем ПК серии Home, что делает их еще более привлекательными для покупки.','2013-01-30 05:49:06','2013-05-20 05:22:34',15490,59,1,'155285_0.1350812350.jpg','DNS',NULL,NULL,NULL,NULL,NULL),(14,581,8,'Гусеничный бульдозер 750J','<p>Сконструированный с таким же расчетом на далекую перспективу, как и наш первый гидростатический бульдозер более 30 лет назад, бульдозер 750J продолжает задавать стандарты земляных работ. Уникальная высокотехнологичная система TMC&trade; (Полный контроль над машиной) позволяет оператору настраивать работу машины в соответствии с личными предпочтениями. В сочетании с необыкновенно плавной работой полнофункциональной гидростатической трансмиссии, бульдозер John Deere 750J обеспечивает непревзойденное регулирование мощности и великолепные результаты.</p>\r\n','2013-01-30 05:53:06','2013-05-20 05:22:24',3000000,85,0,'JD114042_ce_642X462.png','John Deere',1,NULL,NULL,'24','Все компоненты и узлы John Deere Reman получают оригинальную гарантию John Deere, которая соответствует или превосходит условия гарантии эквивалентных новых запчастей.\r\n\r\nГарантия покрывает не только запчасти, но и их установку на машину, если она выполняется дилером John Deere, в остальных случаях гарантия покрывает только сами запчасти.\r\n\r\nДилер John Deere предоставит Вам подробную информацию об условиях уникальной гарантии, которой нет равных в отрасли.');
