INSERT INTO `services` VALUES (1,25,8,'Ремонт холодильников SAMSUNG',' В настоящее время современные холодильники, как и другие изделия бытовой техники (стиральные и посудомоечные машины, плиты), все чаще бывают оснащены электронными микропроцессорными системами управления. Система управления улучшает потребительские характеристики бытовой техники, повышает ее надежность и позволяет в случае возникновения тех или иных дефектов аппарата легко их диагностировать.\r\n\r\nРассмотрим подробнее электронную систему управления, которая используется в комбинированных бытовых холодильниках «Samsung» модели RS21N, RS21H, RS21D, RS21F, RS23N, RS23H, RS23D, RS23F.','2013-01-31 09:07:16','2013-04-18 06:51:16',16,'remont-holod-samsung.jpeg',1000,3000,NULL,NULL,NULL,NULL),(2,25,9,'Ремонт холодильников LG','С 1958 года LG Electronics Inc. остается признанным лидером в области электроники и телекоммуникаций. Модельный ряд холодильников LG отличается особенностями дизайнерского решения и исполнения.\r\n\r\nУ холодильников LG есть вентили на каждой полке, что удерживает образование горячих точек в камере, а значит, холодный воздух рассеивается внутри равномерно. Неизменная температура внутри устройства знаменует лучшую сохранность продуктов и их свежесть. Сенсорная панель на двери холодильника LG дает доступ ко всем его функциям. Беспрекословным достоинством рефрижераторов марки LG является специальный отсек для хранения овощей и фруктов: излучение светодиодов помогает сохранить витамины в продуктах на более длительный срок и предотвратить испарение влаги.','2013-01-31 09:10:03','2013-04-18 06:51:16',18,'remont-holod-lg.jpeg',2000,10000,1,NULL,NULL,NULL),(3,26,8,'Ремонт телевизоров Чайка','Чайка у Вас на дому, в Вашем присутствии. На все услуги по ремонту телевизора Чайка предоставляется гарантия. Наши мастера выполняют такие работы по ремонту телевизора Чайка, как:\r\n\r\n-Ремонт блока питания телевизора\r\n-Ремонт узла цветности телевизора\r\n-Ремонт узла управления телевизора\r\n-Ремонт кадровой развертки телевизора\r\n-Ремонт строчной развертки телевизора\r\n-Ремонт узла дистанционного управления телевизора\r\n-Ремонт пульта управления телевизора\r\n-Ремонт узла приема и обработки сигнала телевизора по высокой частоте\r\n-Ремонт узла приема и обработки сигнала телевизора по низкой частоте\r\n-Замена ручек и кнопок управления телевизора (не пластмасса)\r\n-Настройка и ввод в память телевизионных каналов\r\n-Подключение и настройка видеотехники, DVD, домашних кинотеатров и видеоигр','2013-01-31 09:48:23','2013-05-19 16:24:28',30,'remont-tv-chaika.jpeg',500,2000,NULL,NULL,NULL,NULL);
